import React from "react";
import BotCard from "./BotCard";

function BotCollection({bots}) {
  // Your code here
  const mimi = bots.map(bot => {
    return <BotCard bot={bot} />
  })
  return (
    <div className="ui four column grid">
      <div className="row">
        {mimi}
      </div>
    </div>
  );
}

export default BotCollection;
